import React from 'react'

const App = (props) => {
  const { notes } = props

  const rows = () => notes.map(note =>
    <
    Note key={note.id}
    note={note}
    />
  )
  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {rows()}
      </ul>
    </div>
  )
}

export default App
